1	Privacy Policy	\N	1	<p class="" data-start="89" data-end="154"><strong data-start="89" data-end="116">Privacy Policy &ndash; Handvi</strong><br data-start="116" data-end="119" /><br /></p>\r\n<p class="" data-start="156" data-end="255">At <strong data-start="159" data-end="169">Handvi</strong>, we respect your privacy and are committed to protecting your personal information.</p>\r\n<h3 class="" data-start="257" data-end="278">What We Collect</h3>\r\n<p class="" data-start="279" data-end="397">We may collect your name, email, phone number, company info, and app usage data to provide and improve our services.</p>\r\n<h3 class="" data-start="399" data-end="418">How We Use It</h3>\r\n<p class="" data-start="419" data-end="519">We use your data to create your account, manage access, send updates, and improve app performance.</p>\r\n<h3 class="" data-start="521" data-end="534">Sharing</h3>\r\n<p class="" data-start="535" data-end="642">We do <strong data-start="541" data-end="553">not sell</strong> your data. It may only be shared with trusted service providers or as required by law.</p>\r\n<h3 class="" data-start="644" data-end="661">Your Rights</h3>\r\n<p class="" data-start="662" data-end="723">You can access, update, or delete your information anytime.</p>\r\n<h3 class="" data-start="725" data-end="738">Contact</h3>\r\n<p>&nbsp;</p>\r\n<p class="" data-start="739" data-end="790">For questions, email us at <strong data-start="766" data-end="788">privacy@handvi.com</strong></p>	\N	\N	\N	\N	2025-01-20 17:04:03	2025-04-16 11:13:54
2	Terms and Conditions	\N	1	<p class="" data-start="156" data-end="225"><strong data-start="156" data-end="187">Terms &amp; Conditions &ndash; Handvi</strong><br data-start="187" data-end="190" /><br /></p>\r\n<p class="" data-start="227" data-end="313">Welcome to <strong data-start="238" data-end="248">Handvi</strong>. By using our app or services, you agree to the following terms:</p>\r\n<h3 class="" data-start="315" data-end="337">1. Account Usage</h3>\r\n<p class="" data-start="338" data-end="476">You are responsible for maintaining the confidentiality of your login credentials. Any activity under your account is your responsibility.</p>\r\n<h3 class="" data-start="478" data-end="501">2. Acceptable Use</h3>\r\n<p class="" data-start="502" data-end="608">Do not misuse our services. This includes unauthorized access, sharing harmful content, or violating laws.</p>\r\n<h3 class="" data-start="610" data-end="633">3. Data &amp; Privacy</h3>\r\n<p class="" data-start="634" data-end="749">By using Handvi, you agree to our <a class="" href="#" rel="noopener" data-start="668" data-end="687">Privacy Policy</a>. We collect and use data to provide and improve our services.</p>\r\n<h3 class="" data-start="751" data-end="781">4. Intellectual Property</h3>\r\n<p class="" data-start="782" data-end="900">All content, trademarks, and features in the app are owned by Handvi and may not be copied or used without permission.</p>\r\n<h3 class="" data-start="902" data-end="922">5. Termination</h3>\r\n<p class="" data-start="923" data-end="1002">We may suspend or terminate access to your account if these terms are violated.</p>\r\n<h3 class="" data-start="1004" data-end="1036">6. Limitation of Liability</h3>\r\n<p class="" data-start="1037" data-end="1128">Handvi is not liable for any indirect or incidental damages related to your use of the app.</p>\r\n<h3 class="" data-start="1130" data-end="1155">7. Changes to Terms</h3>\r\n<p>&nbsp;</p>\r\n<p class="" data-start="1156" data-end="1250">We may update these terms at any time. Continued use of Handvi means you accept the new terms.</p>	\N	\N	\N	\N	2025-01-20 17:04:48	2025-04-16 11:14:29
3	About Us	\N	1	<p class="" data-start="184" data-end="217"><strong data-start="184" data-end="217">About Handvi Handmade Product</strong></p>\r\n<p class="" data-start="219" data-end="519">At <em data-start="222" data-end="230">Handvi</em>, we celebrate the beauty of tradition and craftsmanship. Our handmade products are thoughtfully created by skilled artisans who pour their heart into every detail. From intricate designs to high-quality materials, each piece reflects a unique blend of cultural heritage and modern appeal.</p>\r\n<p class="" data-start="521" data-end="767">Whether it's a decorative item for your home or a meaningful gift, Handvi products are crafted with care, sustainability, and authenticity in mind. We believe in empowering local artisans and bringing timeless, handmade elegance to everyday life.</p>	\N	\N	\N	\N	2025-04-17 10:30:41	2025-04-17 10:32:28
